import React, { useState } from "react";
import "../css/signup.css";

import avatar from "../assets/logo.png";
import { Link } from "react-router-dom";
import { useLocation } from "react-router-dom";
import Swal from "sweetalert2";

function EditCourse() {
  const { search } = useLocation();
  const searchParams = new URLSearchParams(search);
  const email = searchParams.get("email");
  // const course_name = searchParams.get("course_name");
  // const course_id = searchParams.get("course_id");
  // const instructor_name = searchParams.get("instructor_name");
  // const course_period = searchParams.get("course_period");

  const initialCourse = {
    course_name: searchParams.get("course_name"),
    course_id: searchParams.get("course_id"),
    instructor_name: searchParams.get("instructor_name"),
    course_period: searchParams.get("course_period"),
  };

  const [course, setCourse] = useState(initialCourse);

  const handleInputChange = (e) => {
    // Update the course state when input fields change
    const { name, value } = e.target;
    setCourse({
      ...course,
      [name]: value,
    });
  };

  return (
    <div>
      <html lang="en">
        <head>
          <meta charset="UTF-8" />
          <meta
            name="viewport"
            content="width=device-width, initial-scale=1.0"
          />
          <meta http-equiv="X-UA-Compatible" content="ie=edge" />
          <link rel="stylesheet" href="../css/signup.css" />
          <title>Edit Courses</title>
        </head>
        <body className="signbody">
          <header>
            <Link to="/home" data-after="About">
              <img className="signuplogo" src={avatar} alt="skillbridge" />
            </Link>
          </header>
          <div className="signlogin-wrapper">
            <form
              // onSubmit={handleFormSubmit}
              method="POST"
              className="signform"
            >
              <h3>Edit Courses</h3>
              <div className="signinput-group">
                <input
                  type="text"
                  name="course_name"
                  id="loginUser"
                  value={course.course_name}
                  onChange={handleInputChange}
                  required
                />
                <label for="loginUser">Course Name</label>
              </div>
              <div className="signinput-group">
                <input
                  type="text"
                  name="course_id"
                  id="loginUser"
                  value={course.course_id}
                  onChange={handleInputChange}
                  required
                />
                <label for="loginUser">Course ID</label>
              </div>
              <div className="signinput-group">
                <input
                  type="text"
                  name="instructor_name"
                  id="loginUser"
                  value={course.instructor_name}
                  onChange={handleInputChange}
                  required
                />
                <label for="loginUser">Instructor Name</label>
              </div>
              <div className="signinput-group">
                <input
                  type="text"
                  name="course_period"
                  id="loginUser"
                  value={course.course_period}
                  onChange={handleInputChange}
                  required
                />
                <label for="loginUser">Course Period</label>
              </div>

              <input
                type="submit"
                value="Continue"
                className="signsubmit-btn"
              />
              {/* <a href="login.html" className="signforgot-pw">Sign in instead</a> */}
              <Link to={`/admin?email=${email}`} className="signforgot-pw">
                Go Back
              </Link>
            </form>
          </div>
        </body>
      </html>
    </div>
  );
}

export default EditCourse;
